import { NavLink } from 'react-router-dom';

export default function ComponentNavigation({navigateTo}) {

  const capitalisedNavigateTo=navigateTo.charAt(0).toUpperCase()+navigateTo.slice(1)
  return (
    <div className='bg-gray-900'>
    <header className="p-8  flex justify-center">
      <nav>
        <ul className="flex gap-4">
          <li>
            <NavLink
                to={`/${navigateTo}`}
            end
              className={({ isActive }) =>
                `px-6 py-2 rounded-md no-underline ${
                  isActive ? 'bg-red-800 text-black' : 'bg-gray-500 text-gray-900'
                } hover:bg-primary-600`
              }
            >
              All {capitalisedNavigateTo}
            </NavLink>
          </li>
          <li>
            <NavLink
              to={`/${navigateTo}/new`}
              className={({ isActive }) =>
                `px-6 py-2 rounded-md no-underline ${
                  isActive ? 'bg-primary-600 text-white' : 'bg-gray-500 text-gray-900'
                } hover:bg-primary-600`
              }
            >
              New {capitalisedNavigateTo}
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
    </div>
  );
}
